    "streamflow-gain-loss-in-the-republican-river-basin-nebraska-may-1975",nt"isopen":
    false,nt"url": null,nt"notes": "This arc and point data set contains streamflow-measurement
    sites and reaches indicating streamflow gain or loss under base-flow conditions
    along Republican River tributaries in Dundy and Chase Counties, Nebraska during
    May 19 to 20, 1975 (U.S. Geological Survey, 1976). The streamflow measurements were
    made to obtain data on ground-water/surface-water interaction. Flow was observed
    visually to be zero, was measured, or was estimated at 55 sites. Tributaries were
    followed upstream until the first road crossing where zero flow was encountered.
    For selected streams, points of zero flow upstream of the first zero flow site also
    were checked. Streamflow gain or loss for each stream reach was calculated by subtracting
    the streamflow values measured at the upstream end of the reach and values for contributing
    tributaries from the downstream value. The data obtained reflected base-flow conditions
    suitable for estimating streamflow gains and losses for stream reaches between sites.
    This digital data set was created by manually splitting the lines from a 1:250,000
    hydrography data set (Soenksen and others, 1999) at every streamflow-measurement
    site. Each set of stream segments between measurement sites was assigned a unique
    reach number.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
